import React, { useState } from "react";

function Table() {
    const [rows, setRows] = useState(0);
    const [cols, setCols] = useState(0);

    const handleSubmit = (e) => {
        e.preventDefault();
        const newRow = parseInt(e.target.row.value);
        const newCol = parseInt(e.target.col.value);
        if (!isNaN(newRow) && !isNaN(newCol)) {
            setRows(newRow);
            setCols(newCol);
        }
    };

    const generateTable = () => {
        const rowsArray = [];
        for (let i = 0; i < rows; i++) {
            const cells = [];
            for (let j = 0; j < cols; j++) {
                cells.push(<td key={j}>Cell {i}-{j}</td>);
            }
            rowsArray.push(<tr key={i}>{cells}</tr>);
        }
        return (
            <table>
                <tbody>
                    {rowsArray}
                </tbody>
            </table>
        );
    };

    return (
        <div>
            <form onSubmit={handleSubmit}>
                <label>Rows:</label>
                <input type="number" name="row" />
                <label>Columns:</label>
                <input type="number" name="col" />
                <button type="submit">Generate Table</button>
            </form>
            {rows > 0 && cols > 0 && generateTable()}
        </div>
    );
}

export default Table;
